#include <vector>

using namespace std;

//贪心
int jump_(vector<int>& v)
{
    int pos = v.size() - 1;
    int step = 0;
    while(pos > 0)
    {
        for(int i = 0; i < pos; ++i)
        {
            if(i + v[i] >= pos)
            {
                pos = i;
                ++step;
                break;
            }
        }
    }

    return step;
}

int jump(vector<int>& v)
{
    int step = 0, maxPos = 0, n = v.size(), end = 0;

    for(int i = 0; i < n - 1; ++i)
    {
        if(maxPos >= i)
        {
            maxPos = max(maxPos, v[i] + i);
            if(i == end)
            {
                end = maxPos;
                ++step;
            }
        }
    }

    return step;
}

bool canJump(vector<int>& v)
{
    int n = v.size(), maxPos = 0;
    for(int i = 0; i < n; ++i)
    {
        if(maxPos >= i)
        {
            maxPos = max(maxPos, v[i] + i);
            if(maxPos > n - 1)
                return true;
        }
    }

    return false;
}

